    def binary_search(start, end, target):
        mid = (start + end) // 2
        if target == mid:
            return [mid, mid]
        elif target < mid:
            return binary_search(start, mid, target)
        else:
            return binary_search(mid + 1, end, target)

    def find_pairs(segments):
        pairs = []
        for i in range(len(segments)):
            for j in range(i + 1, len(segments)):
                if segments[i][1] > segments[j][0]:
                    pairs.append([segments[i][1], segments[j][0]])
                elif segments[i][0] > segments[j][1]:
                    pairs.append([segments[i][0], segments[j][1]])
        return pairs

    def find_nearest_pair(segments, pairs):
        for pair in pairs:
            if segments[pair[0]][1] < pair[1]:
                start, end = pair
            else:
                start, end = pair
            if segments[start][0] > end:
                start, end = end, start
            a, b = binary_search(start, end, pair[0])
            if a!= b:
                return a, b
        return -1, -1

    result = []
    for i in range(q):
        a, b = find_nearest_pair(segments, find_pairs(segments))
