def solution(stdin: str) -> str:
    N = int(stdin.strip())

    # Read input and convert to grid
    grid = [[0] * N for _ in range(N)]
    for line in stdin.splitlines():
        for block in line.strip():
            grid[block.index('.')] = [int(x) for x in block]

    # Find the nearest safe house
    def nearest_safe_house(x: int, y: int) -> int:
        max_dist = float('inf')
        nearest = None
        for i in range(N):
            for j in range(N):
                if i == x and j == y:
                    continue
                if i == 0 or i == N - 1 or j == 0 or j == N - 1:
                    continue
                dist = abs(grid[x][i] - grid[x][j]) + abs(grid[i][j] - grid[x][y])
                if dist < max_dist:
                    max_dist = dist
                    nearest = (x, y)
        return max_dist

    # Find the nearest spy
    def nearest_spy(x: int, y: int) -> int:
        max_dist = float('inf')
        nearest = None
        for i in range(N):
            for j in range(N):
                if i == x and j == y:
                    continue
                if grid[i][j] == 1:
                    dist = abs(x - i) + abs(y - j)
                    if dist < max_dist:
                        max_dist = dist
                        nearest = (i, j)
        return max_dist

    # Find the maximum Manhattan distance
    max_distance = max(nearest_safe_house(i, j) for i in range(N) for j in range(N))
    max_distance = max(max_distance, nearest_spy(i, j) for i in range(N) for j in range(N))
    return str(max_distance)

