    chessboard = [list(row.strip()) for row in stdin.readlines()]

    knight_positions = [(1, 1)]
    steps_taken = 0

    while knight_positions:
        current_position = knight_positions.pop(0)
        steps_taken += 1

        # Check if the current position is a blocked cell
        if chessboard[current_position[0]][current_position[1]] == '#':
            return '-1'

        # Check if the current position is a valid knight position
        if current_position[0] == N - 1 and current_position[1] == N - 1:
            return str(steps_taken)

        # Get valid positions for the current knight
        valid_positions = []
        for move in [(2, 1), (2, -1), (-2, 1), (-2, -1), (1, 2), (1, -2), (-1, 2), (-1, -2)]:
            new_position = (current_position[0] + move[0], current_position[1] + move[1])
            if 0 <= new_position[0] < N and 0 <= new_position[1] < N and chessboard[new_position[0]][new_position[1]] == '.':
                valid_positions.append(new_position)

        # Add the valid positions to the knight positions list
        knight_positions += valid_positions

    return '-1'

