    encrypted_text = ""
    row, col = 0, 0

    for i, c in enumerate(plaintext):
        if c == 'x':
            if i > 0:
                if key_table[row - 1][col - 1] == key_table[row][col - 1] and key_table[row - 1][col] == key_table[row][col]:
                    encrypted_text += 'X'
                    row += 1
                elif key_table[row - 1][col - 1] == key_table[row][col] and key_table[row][col - 1] == key_table[row - 1][col]:
                    encrypted_text += 'X'
                    col += 1
            else:
                encrypted_text += 'X'
                col += 1
        elif c in 'abcdefghijklmnopqrstuvwxyz':
            if c == key_table[row][col]:
                if i > 0:
                    if key_table[row - 1][col - 1] == key_table[row - 1][col] and key_table[row][col - 1] == key_table[row - 1][col - 1]:
                        encrypted_text += 'X'
                        row -= 1
                    elif key_table[row - 1][col - 1] == key_table[row][col - 1] and key_table[row - 1][col] == key_table[row - 1][col - 1]:
                        encrypted_text += 'X'
                        col -= 1
                else:
                    encrypted_text += 'X'
                    col -= 1
